import React from 'react'
import { Attribute } from '../HtmlTag/Attribute'
import { Tag } from '../HtmlTag/Tag'
import { Comment } from '../HtmlTag/Comment'
import ReactTypingEffect from 'react-typing-effect'

export const Welcome = () => {
    const name = (
        `<h1 className="welcome__title">
            <Tag>
                Welcome
                <Attribute attrinute="name" attrinuteValue="Anton" />
                <Attribute attrinute="surname" attrinuteValue="Nikonov" />
            </Tag>
        </h1>`
    )
    return (
        <section className="welcome">
            <ReactTypingEffect
                text={name}
                displayTextRenderer={(text) => {
                    return (
                        {text}
                    )}
                }
            />

            <p>
                <Comment>Creative frontend developer</Comment>
            </p>
        </section>
    )
}
